        Grouping(group_axis, gpr, obj=obj, name=gpr, level=None, sort=sort, observed=observed, in_axis=True)
        if isinstance(gpr, (str, int)) else gpr
        for gpr in keys
    ]

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, [], obj
